"use strict";
// Define the array of names
const names = ["Amir", "Kashif", "Nadeem", "Asad"];
// Print each person's name one at a time
console.log(names[0]); // Amir
console.log(names[1]); // Kashif
console.log(names[2]); // Nadeem                                                                                                   
console.log(names[3]); // Asad
// Define the array of names
const friendsNames = ["Amir", "Kashif", "Nadeem", "Asad"];
// Print each person's name using a loop
for (const friendsName of friendsNames) {
    console.log(friendsName);
}
